import React from 'react'
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';

export default function CreateProducts(props) {
    const [heater, setHeater] = useState(props.heater);
    const [stereo, setstereo] = useState(props.stereo)

    return (
        <div>
            <select name="type" id="type" > 
                <option value="ac" id="ac">AC</option>
                <option value="light" id="light">Light</option>
                {heater}
                {stereo}
            </select>
        </div>
    )
}
